import Vue from "vue";
import VueRouter from 'vue-router'
import testView from '../views/testView'

Vue.use(VueRouter)

const routes = [
    {
        path: '/',
        name: 'test',
        component: testView
    }
]

const router = new VueRouter({
    mode: 'history',
    base: process.env.BASE_URL,
    routes
})

export default router
